import React from 'react';

const SiteSelection = ({ sites }) => {
  
  const handleAccessFolder = (url) => {
    window.open(url, '_blank');
  };

  return (
    <div>
      <h2>Select a Site</h2>
      {sites.map((site) => (
        <div key={site.name}>
          <button onClick={() => handleAccessFolder(site.url)}>{site.name}</button>
        </div>
      ))}
    </div>
  );
};

export default SiteSelection;
